

function orderFood()
{
    let display =    document.querySelector("#display")
    let orderid = document.querySelector("#orderid")
let wait =  document.getElementById("wait")

    let round= document.createElement("img")  

    round.src = "https://c.tenor.com/FBeNVFjn-EkAAAAC/ben-redblock-loading.gif"
    
    wait.append(round)


    let order  =document.querySelector("#order").value
    let status = "open"
    console.log( order)

  
   
    let mypromise = new Promise(function(resolve,reject)  //Promise - capital P means Constructor function
    {
            let time = Math.random()*10*1000; // random value from 0 to 10 sec
         console.log(time)
        
            setTimeout(function()
            {
                if(status === "open")
                {
                   resolve(order)
                   wait.innerHTML = null
                }
                else{
                    reject()
                }
            },time);
    });

    let image = document.createElement("img")

    // let orderid = document.createElement("p")
  
    mypromise.then(function (res) {
        wait.innerHTML = null
        if(order === "pasta")
      {
         image.src = "data:image/jpeg;base64,"
         display.append(image)
         orderid.append(`Order id : ${1} `)
         console.log(`${res} is ready`);
        
        }
      
      else  if( order == "biryani")
        {
            image.src =" data:image/jpeg;base64,"
            display.append(image)
            orderid.append(`Order id : ${2} `)
            console.log(`${res} is ready`);
        }
       
      else  if( order == "pulao")
        {
            image.src ="data:image/jpeg;base64," 
            display.append(image)
            orderid.append(`Order id : ${3} `)
            console.log(`${res} is ready`);
        }
       
      });

      display.innerHTML = null
      orderid.innerHTML = null
     
      
}